import React from "react";

function Login() {
    return (
        <body className="text-center">
            <form className="form-signin">

                <h1 className="h3 mb-3 font-weight-normal">Faça login</h1>
                <label for="inputEmail" className="sr-only"></label>
                <input type="email" id="inputEmail" className="form-control" placeholder="Seu email" required autofocus />
                <label for="inputPassword" className="sr-only"></label>
                <input type="password" id="inputPassword" className="form-control" placeholder="Senha" required />
                <div className="checkbox mb-3">
                    <label>
                        <p>Não está cadastrado? clique aqui</p>
                    </label>
                </div>
                <button className="btn btn-lg btn-primary btn-block" type="submit">Login</button>
                <p className="mt-5 mb-3 text-muted">&copy; 2021</p>
            </form>
        </body>
    );
}

export default Login;
